const e=JSON.parse('{"key":"v-7df095e0","path":"/en/train/eda/chip-circuit/Part_5-std_cell/5_10_%E7%89%A9%E7%90%86%E8%AE%BE%E8%AE%A1%E4%B8%AD%E7%9A%84%E5%A4%87%E7%94%A8%E5%8D%95%E5%85%83%20.html","title":"5.10 Spare Cell","lang":"en-US","frontmatter":{"title":"5.10 Spare Cell","order":10},"headers":[{"level":2,"title":"备用单元：","slug":"备用单元","link":"#备用单元","children":[]},{"level":2,"title":"备用单元的用途：","slug":"备用单元的用途","link":"#备用单元的用途","children":[]},{"level":2,"title":"备用单元的布局：","slug":"备用单元的布局","link":"#备用单元的布局","children":[{"level":3,"title":"Innovus工具：","slug":"innovus工具","link":"#innovus工具","children":[]},{"level":3,"title":"ICC工具：","slug":"icc工具","link":"#icc工具","children":[]}]},{"level":2,"title":"备用单元的优缺点：","slug":"备用单元的优缺点","link":"#备用单元的优缺点","children":[]},{"level":2,"title":"谢谢","slug":"谢谢","link":"#谢谢","children":[]}],"git":{"createdTime":1723131714000,"updatedTime":1723131714000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":3.74,"words":1122},"filePathRelative":"en/train/eda/chip-circuit/Part_5-std_cell/5_10_物理设计中的备用单元 .md","localizedDate":"August 8, 2024","excerpt":"<p>旦芯片制造出来，如果在其中发现任何功能问题或需要在下一次制造中进行某些功能增强，那可真是个棘手的任务。不过，有了备用单元，这些改动可以变得轻而易举。</p>\\n<p>那么备用单元究竟是什么呢？简而言之，备用单元就是在设计中预先放置的一些类似DFF（触发器）、NAND、AND、XOR、INV（反相器）等的单元。它们并不执行任何逻辑操作，只是作为一种填充单元存在。</p>\\n<h2> 备用单元：</h2>\\n<p>备用单元通常由一组标准单元组成，其中包括反相器、缓冲器、NAND、NOR、与门、或门、异或门、多路复用器、触发器等等。</p>\\n<div style=\\"text-align:center;\\">\\n  <img src=\\"/res/images/train_eda_5/spareCell.png\\" alt=\\"ASIC Flow\\" width=\\"300\\">\\n</div>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{e as data};
